import './App.css';
// import axios from 'axios';
import { useState } from 'react';
import { Form, FormGroup, Input, Label } from 'reactstrap';



function App() {
  const [employee, setEmployee] = useState({
    employee_name: "",
    employee_surname: "",
    employee_birthday: "",
    employee_birthplace: "",
    city_id: "",
    district_id: "",
    address_type_id: "",

  })






  return (
    <div className='container'>
      <div className='row'>
        <div className='col-lg-6'>

          <FormGroup>
            <Label for="name">Please enter name</Label>
            <Input type="email" name="email" placeholder="Please enter name" />
          </FormGroup>
          <FormGroup>
            <Label for="surname">Please enter surname</Label>
            <Input type="text" name="text" placeholder="with a placeholder" />
          </FormGroup>
          <FormGroup>
            <Label for="birthday">Please enter birth day</Label>
            <Input type="date" name="birthday" placeholder="with a placeholder" />
          </FormGroup>
          <FormGroup>
            <Label for="birthplace">Please enter birthplace</Label>
            <Input type="text" name="birthplace" placeholder="with a placeholder" />
          </FormGroup>

        </div>
      </div>
    </div>


  );
}

export default App;
